description:
This analysis is a reuse of PMSI database (annual data 2011-2016). The report covers the main features of the France Coronary Stents Market over the period: 
- hospital activity (number of PTCA procedures);
- market by type of stent (bare-metal stents, drug-eluting stents by active substance);
- key players and market shares. 
